// src/components/Dashboard/Dashboard.jsx
import React from 'react';
import "./style.css";

const Dashboard = ({shopItems}) => {
  
  return (
    <div className="table-container">
      <h2>User Table</h2>
      <table className="custom-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Age</th>
            <th>Job</th>
          </tr>
        </thead>
        <tbody>
          {shop.map((user) => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.name}</td>
              <td>{user.age}</td>
              <td>{user.job}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
